import Head from 'next/head'
import useStore from '../components/bag'

export default function Bag() {
    const { bag } = useStore()

    return (
        <div className="container">
            <Head>
                <title>Bag</title>
                <link rel="icon" href="/favicon.ico" />
            </Head>

            <main>
                {bag.map(item => (
                    <li></li>
                ))}
            </main>
        </div>
    )
}
